тью собрана в Appearance - Customize - Front Page Sections.\r\nЭто альтернативный способ сборки хомяков, который можно использовать в случае, если в качестве Front Page выбрана статическая страница, а пользователь по каим-то причинам не хочет/не может использовать Visual Composer, SiteOrigin Panels или любой другой PageBuilder\";s:24:\"front_page_about_content\";s:700:\"<p style=\"text-align: center\">Произвольный текст, который может содержать <strong>теги оформления</strong>, шорткоды и прочее. <br />Создается в стандартном текстовом редакторе WordPress.<br />Если нужно использовать более \"продвинутое\" оформление - можно создать контент этой секции на странице, назначенной в качестве Front Page,<br />а в поле \"Content\" этой секции указать макроподстановку %% CONTENT %% (без пробелов внутри)</p>\";s:19:\"front_page_sections\";s:104:\"title=1|features=1|about=1|team=1|testimonials=1|blog=1|woocommerce=1|subscribe=1|contacts=1|googlemap=1\";s:19:\"front_page_bg_image\";s:65:\"http://trex3.dev.themerex.net/wp-content/uploads/2016/10/bg_2.jpg\";s:24:\"front_page_about_bg_mask\";s:3:\"0.5\";s:23:\"front_page_about_scheme\";s:4:\"dark\";s:24:\"front_page_about_caption\";s:30:\"Heading of the \"About\" section\";s:28:\"front_page_about_description\";s:67:\"Краткое описание содержимого секции\";s:31:\"front_page_features_description\";s:320:\"Секция первоначально предназначена для вставки виджета \"ThemeREX Addons - Services\".\r\nНо можно вставить любой другой виджет или набор виджетов, изменив тем самым содержимое данной секции\";s:27:\"front_page_team_description\";s:447:\"Эта секция предназначена для вывода членов команды.\r\nНо, так как команда выводится виджетом \"ThemeREX Addons - Team\", то эта секция может использоваться для вставки любого набора виджетов и таким образом ее можно перепрофилировать на любой другой контент\";s:23:\"front_page_title_anchor\";s:17:\"Big title section\";s:26:\"front_page_features_anchor\";s:12:\"Our Services\";s:23:\"front_page_about_anchor\";s:8:\"About Us\";s:22:\"front_page_team_anchor\";s:8:\"Our Team\";s:28:\"front_page_title_anchor_icon\";s:14:\"icon-book-open\";s:28:\"front_page_title_anchor_text\";s:18:\"Welcome to my Blog\";s:28:\"front_page_about_anchor_icon\";s:10:\"icon-globe\";s:28:\"front_page_about_anchor_text\";s:8:\"About Us\";s:31:\"front_page_features_anchor_icon\";s:10:\"icon-brush\";s:31:\"front_page_features_anchor_text\";s:12:\"Our Services\";s:27:\"front_page_team_anchor_icon\";s:16:\"icon-users-group\";s:27:\"front_page_team_anchor_text\";s:8:\"Our Team\";s:35:\"front_page_testimonials_description\";s:448:\"Эта секция предназначена для вывода отзывов благодарных клиентов.\r\nНо, как и в случае с предыдущей секцией, отзывы выводятся виджетом \"ThemeREX Addons - Testimonials\", а значит можно вставить в нее любой другой набор виджетов и тем самым изменить ее содержимое\";s:35:\"front_page_testimonials_anchor_icon\";s:11:\"icon-wechat\";s:35:\"front_page_testimonials_anchor_text\";s:15:\"Our clients say\";s:27:\"front_page_blog_description\";s:376:\"Еще одна секция с легко изменяемым контентом.\r\nИзначально предназначается для вывода последних постов, но так же, как и в случае с предыдущими двумя секциями, в нее могут быть вставлены любые другие виджеты\";s:27:\"front_page_blog_anchor_icon\";s:8:\"icon-tag\";s:27:\"front_page_blog_anchor_text\";s:12:\"Latest posts\";s:23:\"front_page_blog_bg_mask\";s:3:\"0.5\";s:22:\"front_page_team_scheme\";s:4:\"dark\";s:24:\"front_page_team_bg_image\";s:71:\"http://trex3.dev.themerex.net/wp-content/uploads/2016/11/portfolio5.jpg\";s:23:\"front_page_team_bg_mask\";s:3:\"0.5\";s:22:\"front_page_blog_scheme\";s:4:\"dark\";s:29:\"front_page_subscribe_paddings\";s:5:\"large\";s:30:\"front_page_subscribe_shortcode\";s:21:\"[mc4wp_form id=\"294\"]\";s:32:\"front_page_subscribe_description\";s:364:\"Содержимое этой секции создается шорткодом, заданным в параметрах. \r\nЭто может быть любой шорткод (набор шорткодов).\r\nИзначально предназначается для вставки шорткода для вывода формы из плагина MailChimp\";s:27:\"front_page_subscribe_scheme\";s:4:\"dark\";s:29:\"front_page_subscribe_bg_image\";s:71:\"http://trex3.dev.themerex.net/wp-content/uploads/2016/11/portfolio2.jpg\";s:28:\"front_page_subscribe_bg_mask\";s:3:\"0.5\";s:32:\"front_page_subscribe_anchor_icon\";s:15:\"icon-mail-empty\";s:32:\"front_page_subscribe_anchor_text\";s:9:\"Subscribe\";s:24:\"front_page_blog_paddings\";s:5:\"small\";s:28:\"front_page_googlemap_caption\";s:0:\"\";s:32:\"front_page_googlemap_description\";s:0:\"\";s:32:\"front_page_googlemap_anchor_icon\";s:13:\"icon-location\";s:32:\"front_page_googlemap_anchor_text\";s:17:\"We are on the map\";s:26:\"front_page_googlemap_boxed\";s:0:\"\";s:29:\"front_page_woocommerce_scheme\";s:4:\"dark\";s:31:\"front_page_woocommerce_bg_image\";s:63:\"http://trex3.dev.themerex.net/wp-content/uploads/2016/10/08.jpg\";s:30:\"front_page_woocommerce_bg_mask\";s:3:\"0.5\";s:34:\"front_page_woocommerce_anchor_icon\";s:15:\"icon-shop-light\";s:34:\"front_page_woocommerce_anchor_text\";s:12:\"Our products\";s:30:\"front_page_woocommerce_caption\";s:16:\"Taste our dishes\";s:34:\"front_page_woocommerce_description\";s:284:\"В настройках этой секции можно выбрать тип отображаемых продуктов:\r\n\"Последние поступления\", \"Бестселлеры\", \"Top rated\", \"Featured\" или продукты из заданной категории\";s:31:\"front_page_woocommerce_products\";s:16:\"product_category\";s:39:\"front_page_woocommerce_products_orderby\";s:5:\"title\";s:37:\"front_page_woocommerce_products_order\";s:3:\"asc\";s:42:\"front_page_woocommerce_products_categories\";s:6:\"dishes\";s:31:\"front_page_woocommerce_paddings\";s:5:\"small\";s:27:\"front_page_googlemap_layout\";s:7:\"columns\";s:29:\"front_page_googlemap_bg_image\";s:84:\"http://trex3.dev.themerex.net/wp-content/uploads/2017/02/apartment-living-room-2.jpg\";s:27:\"front_page_googlemap_scheme\";s:4:\"dark\";s:28:\"front_page_googlemap_bg_mask\";s:3:\"0.5\";s:27:\"front_page_contacts_caption\";s:12:\"Get in touch\";s:31:\"front_page_contacts_description\";s:357:\"Контактная информация и форма обратной связи.\r\nТекст слева полностью изменяемый.\r\nФорма справа - результат работы шорткода [[trx_sc_form]]. Его можно заменить на любой другой шорткод или набор шорткодов\";s:29:\"front_page_contacts_shortcode\";s:28:\"[trx_sc_form style=\"iconed\"]\";s:26:\"front_page_contacts_scheme\";s:4:\"dark\";s:27:\"front_page_contacts_bg_mask\";s:3:\"0.5\";s:31:\"front_page_contacts_anchor_icon\";s:10:\"icon-vcard\";s:31:\"front_page_contacts_anchor_text\";s:10:\"Contact Us\";s:27:\"front_page_contacts_content\";s:315:\"<h5><span class=\"icon-home-2\"> </span>Find us at the office:</h5>\r\n<p>123, Main street<br />0123456, London<br />Great Britain<br />Mon - Fri, 09:00 - 18:00</p>\r\n<h5> <span class=\"icon-mobile-light\"> </span>Give us a call:</h5>\r\n<p>Michael Jordan<br />+40 762 321 762<br />Mon - Fri, 08:00 - 22:00</p>\r\n<p> </p>\";s:28:\"front_page_googlemap_content\";s:742:\"<h3>We are on the map</h3>\r\n<p><em>Текст слева полностью изменяемый.<br />Карта справа - результат работы виджета \"ThemeREX Addons - Google map\". Его можно заменить на любой другой виджет или набор виджетов</em></p>\r\n<h5><span class=\"icon-address\"> </span>Our address:</h5>\r\n<p>123, Main street<br />0123456, London<br />Great Britain</p>\r\n<h5>Nearest stops of public transport:</h5>\r\n<p><span class=\"icon-bus\"> </span>Bus №40 - 5th Avenue and 45th street<br /><span class=\"icon-bus\"> </span>Bus №124 - 5th Avenue and 47th street<br /><span class=\"icon-train\"> </span>Tram №1 - 6th Avenue and 45th street</p>\r\n<p> </p>\";s:18:\"front_page_enabled\";s:1:\"1\";s:25:\"front_page_title_bg_color\";s:7:\"#000000\";s:28:\"front_page_features_bg_color\";s:7:\"#ffffff\";s:25:\"front_page_about_bg_color\";s:7:\"#000000\";s:24:\"front_page_team_bg_color\";s:7:\"#000000\";s:32:\"front_page_testimonials_bg_color\";s:7:\"#ffffff\";s:24:\"front_page_blog_bg_color\";s:7